      <ul>
        <ProductItem
          id="test1"
          title="Test"
          price={6}
          description="This is a first product - amazing!"
        />
        <ProductItem
          id="test2"
          title="Test 2"
          price={8}
          description="This is a second product - amazing!"
        />
        <ProductItem
          id="test3"
          title="Test 3"
          price={8}
          description="This is a second product - amazing!"
        />
      </ul>
    </section>
  );
};

export default Products;
